import React from "react";
import { default as NLink, LinkProps } from "next/link";
import { ReactComponent as DownIcon } from "public/assets/svgs/chevron-down.svg";
export interface ILink extends LinkProps {
  children: JSX.Element | React.ReactNode;
  hasChildren?: boolean;
}
const Link = (props: ILink) => {
  return (
    <li>
      <NLink {...props}>
        <a>
          {props.children} <DownIcon />
        </a>
      </NLink>
    </li>
  );
};

export default Link;
